import React from 'react';
import Slider from './Slider';
import ReactDOM from 'react-dom'; 
import './index.css';
import Header from './Header';
import reportWebVitals from './reportWebVitals';
import './Header.css';
import './Carousel';
import Count from './Count';
import Recientes from './Recientes';
import Compospoty from './compospoty';
import BannerCustom from './BannerCustom';
import SocialMedia from './SocialMedia';
import ContactForm from './ContactForm';
import ExampleComponent from './ExampleComponent';
import SocialMediaList from './SocialMediaList';
import 'bootstrap/dist/css/bootstrap.min.css';
import ProxEvent from './ProxEvent';
import { BrowserRouter, Routes } from 'react-router-dom';

<script src="https://unpkg.com/@themesberg/flowbite@1.1.1/dist/flowbite.bundle.js"></script>

ReactDOM.render(
  <BrowserRouter>
  <React.StrictMode>
  <Route exact path="/" component={index.js} />
  <Routes path="/ProxEvent" component={ProxEvent} />
<div style={{backgroundColor: 'black', height: '10px'}}>

    <ExampleComponent/>
    <SocialMediaList/>
    </div>
    <BannerCustom/>
    <Slider/>
    <Count/>
    <Recientes/>
    <Compospoty/>
    <SocialMedia/>
    <ContactForm/>

  </React.StrictMode>
  </BrowserRouter>
   ,
  document.getElementById('root')
);

reportWebVitals();
